import { createTheme, ThemeProvider } from '@mui/material/styles';
import Navbar from './components/Navbar';

const theme = createTheme({
  palette: {
    primary: {
      light: '#4f5b62',
      main: '#263238',
      dark: '#000a12',
      contrastText: '#fff',
    },
    secondary: {
      light: '#ffffff',
      main: '#efebe9',
      dark: '#bdb9b7',
      contrastText: '#000',
    },
  },
});

function App() {

  return (
  <>
  <ThemeProvider theme={theme}>

    <Navbar/>
  </ThemeProvider>
  </>
  )
}


export default App;
